import './company-add-coupon.css'
import history from './../../../../../../history'
import { Formik, Form, Field } from 'formik'
import { Coupon } from './../../../../../../../../models/Coupon.js'

export default function CompanyAddCoupon() {

    const closeDiv = () => {
        if (window.confirm('Are you sure you want to close this window?'))
            history.push('/company/my-coupons')
    }

    const handleSubmit = (values) => {
        alert(values)
        console.log(values)
    }

    return (
        <>
            <div className='CompanyAddCoupon-background'></div>
            <div className='CompanyAddCoupon'>
                <div className='CompanyAddCoupon-close-div'>
                    <button className="btn-close" aria-label="Close" id='CompanyAddCoupon-close-button' onClick={closeDiv}></button>
                </div>
                <Formik
                    initialValues={{

                    }}
                    onSubmit={handleSubmit}
                >
                    {({ values }) => (
                        <Form>
                            <div class="input-group">
                                <span class="input-group-text">With textarea</span>
                                <Field
                                    name='coupon.id'
                                    className='form-control'
                                    placeholder='Email'
                                    autoComplete='true'
                                />
                            </div>


                            <div className='Login-submit' id='Login-padding'>
                                <button type='submit' className='btn btn-primary' id='Login-input'  >
                                    Login
                                </button>
                            </div>
                        </Form>
                    )}
                </Formik >
            </div>
        </>
    )
}
